import { Card } from 'antd';

const { Meta } = Card;

function HomePage() {

    <Card
        hoverable
        style={{ width: 240 }}
        cover={<img alt="example" src="../assets/img/volleyball.jpg" />}
    >
        <Meta title="Europe Street beat" description="www.instagram.com" />
    </Card>
}

export default HomePage;
